# Sesuaikan bahasa dan teks di Ruang Flatfile Anda

---

Aktifkan terjemahan, penyesuaian, dan penggantian teks untuk Ruang Anda dengan mudah menggunakan dukungan lokal Flatfile.

## Hal yang bisa Anda lakukan di sini

Coba Bahasa yang Berbeda untuk Beberapa Keseruan Anjing! 🌍

Bukankah akan menarik jika anjing bisa berbicara dalam setiap bahasa? Nah, di Playground Lokalisasi Anjing kami, Anda bisa merasakan hal tersebut!

🐕 Coba saja:

- **Inggris**: Tambahkan `?lng=en` ke URL dan muat ulang halaman untuk pengalaman yang cocok dengan English Pointer!
- **Jerman**: Tambahkan `?lng=de` ke akhir URL dan tekan enter untuk pengalaman Jerman yang menggonggong seru.
- **Perancis**: Gunakan `?lng=fr` untuk terjemahan Perancis yang bahkan poodle Perancis akan menyetujui!
- **Spanyol**: Ingin menggonggong dalam bahasa Spanyol? Hanya tambahkan `?lng=es` ke URL.
- **Portugis Brasil**: Tambahkan `?lng=pt-BR` di akhir URL untuk melihat dunia melalui mata Brazillian Terrier.

Kami tidak mengajari anjing untuk menerjemahkan, tetapi file terjemahan.json kami melakukan triknya. Bagian terbaiknya? Halaman Markdown kami memperbarui dirinya sendiri secara dinamis berdasarkan bahasa yang dipilih! Tidak perlu pengkodean keras. 🪄

Jadi, saat Anda menjelajahi Playground Lokalisasi Anjing kami, perhatikan bagaimana kata-kata berubah menjadi bahasa yang Anda pilih. 🌟

Ayo, coba saja! Jelajahi dunia anjing dalam bahasa yang berbeda dan lihat bagaimana lokalisasi membuat web menjadi tempat yang sangat menyenangkan bagi semua orang! 🌐

Lihat [terjemahan yang diubah sesuai tema anjing di sini](https://github.com/FlatFilers/Platform-Translations/blob/demo-structure/locales/en/translation.json). Anda juga bisa melihat kode sumber untuk ruang ini dalam [Typescript](https://github.com/FlatFilers/flatfile-docs-kitchen-sink/blob/main/typescript/localization/index.ts) dan [Javascript](https://github.com/FlatFilers/flatfile-docs-kitchen-sink/blob/main/javascript/localization/index.js).

## Membuat Ruang ini

Ruang ini telah dikonfigurasi dengan opsi lokalisasi.

Berikut tampilan kode yang digunakan untuk membuatnya:

```jsx
import api from "@flatfile/api";
import { Client, FlatfileEvent, FlatfileListener } from "@flatfile/listener";

export default function flatfileEventListener(listener: Client) {
  listener.filter({ job: "space:configure" }, (configure: FlatfileListener) => {
    configure.on(
      "job:ready",
      async ({ context: { spaceId, environmentId, jobId } }: FlatfileEvent) => {
        try {
          await api.jobs.ack(jobId, {
            info: "Job started.",
            progress: 10,
          });

          //Dokumen menggunakan kunci terjemahan alih-alih mengkodekan string dengan keras
          const document = await api.documents.create(spaceId, {
            title: "myDocument.title",
            body: "myDocument.body",
          });

          //Mengatur jalur terjemahan untuk ruang
          await api.spaces.update(spaceId, {
            metadata: {
              sidebarConfig: {
                defaultPage: {
                  documentId: document.data.id,
                },
              },
            },
            translationsPath:
              "https://raw.githubusercontent.com/FlatFilers/Platform-Translations/demo-structure/locales/en/translation.json",
          });


          await api.workbooks.create({
            spaceId,
            environmentId,
            ...
          });

          await api.jobs.complete(jobId, {
            outcome: {
              message: "Job completed.",
            },
          });
        } catch (error: any) {
          console.error("Error: ", error.stack);

          await api.jobs.fail(jobId, {
            outcome: {
              message: "Job error.",
            },
          });
        }
      }
    );
  });
}
```

